/* Global CSS - All pages */

.v-navigation-drawer {
    border: 0px solid transparent;
    color: #000000;
    background-color: transparent !important;
}

.elevation-1 {
    box-shadow: 0 0px 0px 0px !important;
}

.v-toolbar-title__placeholder {
    color: #000000 !important;
    font-weight: bold;
}

template {
    background-color: white !important;
}

/* Custom CSS - Home page */

/* .styled-button-visual */

.styled-button-visual .v-btn .v-icon {
    height: 0px !important;
    --v-icon-size-multiplier: 3;
    color: #000000;
}

.styled-button-visual .v-btn {
    background-color:rgba(255, 0, 0, 0);
    padding: 2.5em 2.5em;
}

/* .button-label */

.button-label span.nrdb-ui-text-value {
    color: #000000;
    font-weight: bold;
    font-size: 14px;
    margin-bottom: 10%;
}

/* .styled-button */

.styled-button .v-btn .v-icon {
    height: 0px !important;
    --v-icon-size-multiplier: 3;
}

.styled-button .v-btn {
    padding: 3.5em 3.5em;
}

/* .title-top */

.title-top {
    margin-bottom: 25px;
}

/* .top-button */

.top-button {
    justify-content: center;
    width: 100%;
}

.top-button .v-btn {
    border-radius: 10px;
}

.top-button .v-btn * {
    font-size: xx-large;
    padding: 0.5em 2em;
}

/* .information-text */

.information-text label {
    text-align: center;
    background-color: #000000;
    padding: 2% 12% 2% 12%;
    min-width: 60%;
    border-radius: 20px;
    color: #ffffff
}

.information-text span.nrdb-ui-text-value {
    color: #000000;
    font-size: 14px;
    margin-bottom: 11%;
}

/* .top-home */

.top-home {
    margin-bottom: 2rem;
    background-color: transparent !important;
}

